// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title ModelMarketplace
 * @dev A contract for creators to register their AI models on the blockchain.
 */
contract ModelMarketplace is Ownable {

    struct Model {
        address payable creator;
        bytes32 modelHash; // e.g., IPFS hash of the model
        string metadata; // e.g., IPFS hash of a metadata JSON file
        uint256 price; // Price in DAI tokens
        bool isListed;
    }

    // Mapping from model hash to Model details
    mapping(bytes32 => Model) public models;

    // An array to keep track of all model hashes for discoverability
    bytes32[] public modelHashes;

    event ModelListed(address indexed creator, bytes32 indexed modelHash, uint256 price);
    event ModelDelisted(bytes32 indexed modelHash);
    event ModelPriceUpdated(bytes32 indexed modelHash, uint256 newPrice);

    constructor() Ownable(msg.sender) {}

    /**
     * @dev Allows a creator to list a new model on the marketplace.
     * @param _modelHash A unique hash representing the model.
     * @param _metadata A string for additional data, like an IPFS content ID.
     * @param _price The price for using the model, in the smallest unit of DAI token.
     */
    function listModel(
        bytes32 _modelHash,
        string calldata _metadata,
        uint256 _price
    ) external {
        require(!models[_modelHash].isListed, "Model already listed");

        models[_modelHash] = Model({
            creator: payable(msg.sender),
            modelHash: _modelHash,
            metadata: _metadata,
            price: _price,
            isListed: true
        });

        modelHashes.push(_modelHash);

        emit ModelListed(msg.sender, _modelHash, _price);
    }

    /**
     * @dev Allows the creator of a model to delist it.
     * @param _modelHash The hash of the model to delist.
     */
    function delistModel(bytes32 _modelHash) external {
        require(models[_modelHash].creator == msg.sender, "Not the model creator");
        require(models[_modelHash].isListed, "Model not listed");

        models[_modelHash].isListed = false;

        emit ModelDelisted(_modelHash);
    }

    /**
     * @dev Allows the creator of a model to update its price.
     * @param _modelHash The hash of the model to update.
     * @param _newPrice The new price for the model.
     */
    function updateModelPrice(bytes32 _modelHash, uint256 _newPrice) external {
        require(models[_modelHash].creator == msg.sender, "Not the model creator");
        require(models[_modelHash].isListed, "Model not listed");

        models[_modelHash].price = _newPrice;

        emit ModelPriceUpdated(_modelHash, _newPrice);
    }

    /**
     * @dev Returns the details of a specific model.
     * @param _modelHash The hash of the model to query.
     * @return creator, metadata, price, isListed
     */
    function getModel(bytes32 _modelHash) external view returns (address, string memory, uint256, bool) {
        Model storage modelData = models[_modelHash];
        return (modelData.creator, modelData.metadata, modelData.price, modelData.isListed);
    }

     /**
     * @dev Returns the total number of models listed.
     */
    function totalModels() external view returns (uint256) {
        return modelHashes.length;
    }
}

