// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./DeAIToken.sol";

/**
 * @title RewardDistribution
 * @dev This contract distributes rewards to compute providers.
 * It has the authority to mint new DeAIToken (DAI) tokens.
 */
contract RewardDistribution is Ownable {
    DeAIToken public immutable daiToken;

    // This could be a more complex formula in a real-world scenario
    uint256 public rewardFactor = 1;

    event RewardDistributed(address indexed provider, uint256 amount);

    /**
     * @dev Sets the DeAIToken contract address.
     */
    constructor(address tokenAddress) Ownable(msg.sender) {
        daiToken = DeAIToken(tokenAddress);
    }

    /**
     * @dev Sets the reward factor.
     * Only the owner can change the reward factor.
     */
    function setRewardFactor(uint256 _rewardFactor) external onlyOwner {
        rewardFactor = _rewardFactor;
    }

    /**
     * @dev Distributes rewards to a compute provider.
     * In a real implementation, this would be called by a trusted oracle or the backend
     * that has verified the compute task.
     * For now, only the owner can call this function for simplicity.
     * @param provider The address of the compute provider.
     * @param computeTime The time spent on the compute task.
     * @param requestValue A value representing the importance or cost of the request.
     */
    function distributeReward(address provider, uint256 computeTime, uint256 requestValue) external onlyOwner {
        // Simple reward calculation
        uint256 rewardAmount = (computeTime * requestValue * rewardFactor) / 1e18;

        // Mint new tokens to the provider
        daiToken.mint(provider, rewardAmount);

        emit RewardDistributed(provider, rewardAmount);
    }

    /**
     * @dev Transfers ownership of the DeAIToken contract to this contract.
     * This is necessary for this contract to be able to mint new tokens.
     * This should be called by the original deployer of the DeAIToken contract.
     */
    function claimTokenOwnership() external onlyOwner {
        daiToken.transferOwnership(address(this));
    }
}

contracts/Staking.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./DeAIToken.sol";

/**
 * @title Staking
 * @dev This contract allows compute nodes to stake DeAIToken (DAI) as collateral.
 * This stake can be slashed by the contract owner in case of fraudulent behavior.
 */
contract Staking is Ownable {
    IERC20 public immutable daiToken;

    mapping(address => uint256) public stakes;

    event Staked(address indexed node, uint256 amount);
    event Unstaked(address indexed node, uint256 amount);
    event Slashed(address indexed node, uint256 amount);

    /**
     * @dev Sets the DeAIToken address.
     */
    constructor(address tokenAddress) Ownable(msg.sender) {
        daiToken = IERC20(tokenAddress);
    }

    /**
     * @dev Allows a node to stake a certain amount of DAI tokens.
     * The node must approve the contract to spend the tokens first.
     * @param amount The amount of DAI to stake.
     */
    function stake(uint256 amount) external {
        require(amount > 0, "Staking amount must be positive");
        stakes[msg.sender] += amount;
        require(daiToken.transferFrom(msg.sender, address(this), amount), "Token transfer failed");
        emit Staked(msg.sender, amount);
    }

    /**
     * @dev Allows a node to unstake their DAI tokens.
     * @param amount The amount of DAI to unstake.
     */
    function unstake(uint256 amount) external {
        require(amount > 0, "Unstaking amount must be positive");
        require(stakes[msg.sender] >= amount, "Insufficient stake");
        stakes[msg.sender] -= amount;
        require(daiToken.transfer(msg.sender, amount), "Token transfer failed");
        emit Unstaked(msg.sender, amount);
    }

    /**
     * @dev Slashes the stake of a fraudulent node.
     * Only the owner of the contract can call this function.
     * @param node The address of the fraudulent node.
     * @param amount The amount of stake to slash.
     */
    function slash(address node, uint256 amount) external onlyOwner {
        require(stakes[node] >= amount, "Insufficient stake to slash");
        stakes[node] -= amount;
        // The slashed tokens are kept in the contract and can be transferred to a treasury or burned.
        emit Slashed(node, amount);
    }
}

